import {  BrowserRouter, Route, Routes } 
        from 'react-router-dom'

import {NotFound} from '../404/404Page';
import Home from "../Home/Home";

function App() {
  return (

      <BrowserRouter>

  <Routes>
    <Route path="*" element={<NotFound />} />
    <Route path="/" element={<Home />} />
  </Routes>
  </BrowserRouter>
  );
}

export default App;
